пугая/корм для попугая", "перрико"], "25": ["Пришли жердочки целые. Сразу повесила попугаю. Пока не оценил - боится нового гаджетов в клетке. Но думаю, что должен освоить", "2021-03-22T16:16:22Z", "", "0", 1, 0, 5, "Минеральные жердочки для попугаев Морской Риф 2 шт/жердочка для попугая/корм для попугая", "перрико"], "26": ["Попугай даже не подошёл к ней.", "2021-03-21T19:37:24Z", "", "0", 1, 0, 3, "Минеральные жердочки для попугаев Морской Риф 2 шт/жердочка для попугая/корм для попугая", "перрико"], "27": ["Идея классная! Но неразлучники не заценили от слова совсем. Даже не притронулись за 4 месяца. Хотя пробовала и горизонтально и вертикально её крепить, толку нет. И крепёж маловат для больших клеток.", "2021-03-18T17:07:41Z", "", "0", 1, 0, 4, "Минеральные жердочки для попугаев Морской Риф 2 шт/жердочка для попугая/корм для попугая", "перрико"], "28": ["Отличные палочки,попугаям понравились", "2021-03-17T11:16:55Z", "", "0", 2, 0, 5, "Минеральные жердочки для попугаев Морской Риф 2 шт/жердочка для попугая/корм для попугая", "перрико"], "29": ["Палочки отличные, в пользовании уже 4 месяца. Попугай сидит, грызет, чистит клюв. Признал не сразу, через неделю проявил интерес", "2021-03-16T05:09:11Z", "", "0", 1, 0, 5, "Минеральные жердочки для попугаев Морской Риф 2 шт/жердочка для попугая/корм для попугая", "перрико"], "30": ["Доставка отвратительная. Коробка переклеена скотчем, разорвана. Неужели нельзя запаковать хотя бы в пакет? \nПоучитесь у Китайцев упаковке товаров, приезжают издалека, доставленные почтой России целыми.", "2021-03-15T14:47:57Z", "", "0", 3, 1, 3, "Минеральные жердочки для попугаев Морской Риф 2 шт/жердочка для попугая/корм для попугая", "перрико"], "31": ["Отличные жёрдочки!", "2021-03-14T17:09:21Z", "", "0", 1, 0, 5, "Минеральные жердочки для попугаев Морской Риф 2 шт/жердочка для попугая/корм для попугая", "перрико"], "32": ["Крепление хорошее. Пришло целое. Машка (попугай), пока шугается своего подарка к 8 Марта. Но прошло только пол дня. Позже дополню отзыв. ", "2021-03-13T17:11:16Z", "", "0", 3, 0, 5, "Минеральные жердочки для попугаев Морской Риф 2 шт/жердочка для попугая/корм для попугая", "перрико"], "33": ["Удобно крепятся к клетке. Без посторонних запахов.", "2021-03-10T02:39:51Z", "", "0", 1, 0, 5, "Минеральные жердочки для попугаев Морской Риф 2 шт/жердочка для попугая/корм для попугая", "перрико"], "34": ["Такие хорошие палочки, а мои дундуки не понимают, что их надо грызть.", "2021-03-07T14:42:56Z", "", "0", 6, 1, 5, "Минеральные жердочки для попугаев Морской Риф 2 шт/жердочка для попугая/корм для попугая", "перрико"], "35": ["Снимаю одну звезду за качество упаковки,пришла вся переклеенная скотчем,открытая,но сам товар целый. Для моей большой клетки с расстоянием между прутьями 2см, крепление не подошло. Пришлось крепить подручными импровизиррванными шайбами)))) Попугай пока ужасно боится этой жерди,но надеюсь,что освоится и  полюбит,он у нас ещё малыш совсем))))", "2021-03-04T06:00:16Z", "", "0", 3, 1, 4, "Минеральные жердочки для попугаев Морской Риф 2 шт/жердочка для попугая/корм для попугая", "перрико"], "36": ["Для средних попугаев шикарная жердочка, ожереловый пернатый оценил, сидит теперь только на них и клюв точит, только шайбочки для большой клетки маловаты, пришлось немного переделать (не критично), в целом я довольна", "2021-03-01T10:34:29Z", "", "0", 1, 0, 5, "Минеральные жердочки для попугаев Морской Риф 2 шт/жердочка для попугая/корм для попугая", "перрико"], "37": ["Коробка пришла открытая., всё вывалилось. И попугай почему обходит её стороной.", "2021-02-28T20:02:36Z", "", "0", 1, 0, 3, "Минеральные жердочки для попугаев Морской Риф 2 шт/жердочка для попугая/корм для попугая", "перрико"], "38": ["Жердочка волнистику понравилась, она на ней сидит. Но пока, к сожалению не грызет. ", "2021-02-28T14:26:20Z", "", "0", 1, 0, 5, "Минеральные жердочки для попугаев Морской Риф 2 шт/жердочка для попугая/корм для попугая", "перрико"], "39": ["Хороший минеральный камушек!Пришёл без брака,все отлично!", "2021-02-27T16:49:41Z", "", "0", 1, 0, 5, "Минеральные жердочки для попугаев Морской Риф 2 шт/жердочка для попугая/корм для попугая", "перрико"], "40": ["Красивые жердочки. Правда попугай не понимает, что их можно ещё и грызть, только сидит на них", "2021-02-27T12:11:29Z", "", "0", 1, 0, 5, "Минеральные жердочки для попугаев Морской Риф 2 шт/жердочка для попугая/корм для попугая", "перрико"], "41": ["Все хорошо!!!", "2021-02-27T07:14:49Z", "", "0", 1, 0, 5, "Минеральные жердочки для попугаев Морской Риф 2 шт/жердочка для попугая/корм для попугая", "перрико"], "42": ["Птица пока не совсем поняла, что с этим делать 😁", "2021-02-25T10:56:37Z", "", "0", 17, 0, 5, "Минеральные жердочки для попугаев Морской Риф 2 шт/жердочка для попугая/корм для попугая", "перрико"], "43": ["Пришли в коробочке,сразу повесила,моему Цыпе понравилась,сел сразу и начал грызть", "2021-02-25T10:38:14Z", "", "0", 6, 0, 5, "Минеральные жердочки для попугаев Морской Риф 2 шт/жердочка для попугая/корм для попугая", "перрико"], "45": ["Птичке понравилось.", "2021-02-23T05:35:37Z", "", "0", 10, 0, 5, "Минеральные жердочки для попугаев Морской Риф 2 шт/жердочка для попугая/корм для попугая", "перрико"], "46": ["Хорошие жердочки, сразу понравились попугайчикам - тут же стали пробовать это дело на зуб. Можно и погрызть и посидеть... Опять же коготки стачиваются. Удобное надежное крепление - большой плюс. На мой взгляд это один из лучших вариантов минерального камня.", "2021-02-19T19:37:31Z", "", "0", 2, 0, 5, "Минеральные жердочки для попугаев Морской Риф 2 шт/жердочка для попугая/корм для попугая", "перрико"], "47": ["Пришли быстро", "2021-02-18T15:23:16Z", "", "0", 1, 0, 5, "Минеральные жердочки для попугаев Морской Риф 2 шт/жердочка для попугая/корм для попугая", "перрико"], "48": ["Пришли в доп. упаковке, мне всё понравилось, а вот волнистик не грызет(думала мб её будет грызть, но нет)", "2021-02-16T09:58:32Z", "", "0", 2, 0, 5, "Минеральные жердочки для попугаев Морской Риф 2 шт/жердочка для попугая/корм для попугая", "перрико"], "49": ["Жерди классные,но шайбы маловаты!\nНа более крупную клетку с большим растоянием между прутьев,шайбы проваливаются и жердь не держится!!!", "2021-02-15T13:47:56Z", "", "0", 1, 0, 4, "Минеральные жердочки для попугаев Морской Риф 2 шт/жердочка для попугая/корм для попугая", "перрико"], "50": ["Пришли обе целые, к клетке крепятся хорошо, но Ричи пока не понял, что это. ", "2021-02-15T12:20:54Z", "", "0", 2, 1, 5, "Минеральные жердочки для попугаев Морской Риф 2 шт/жердочка для попугая/корм для попугая", "перрико"], "51": ["Норм жердочки. Какарик на них сидит нормально. Но особо не грызет.", "2021-02-14T16:18:49Z", "", "0", 1, 0, 5, "Минеральные жердочки для попугаев Морской Риф 2 шт/жердочка для попугая/корм для попугая", "перрико"], "52": ["Коробка была вскрыта и немного порвана... не была упакована в пакет... жердочки целы", "2021-02-10T17:24:37Z", "", "0", 1, 1, 4, "Минеральные жердочки \"Морской Риф\" для попугаев, 2 шт", "перрико"], "53": ["Целые палочки не ломаные)", "2021-02-09T16:52:59Z", "", "0", 1, 0, 5, "Минеральные жердочки \"Морской Риф\" для попугаев, 2 шт", "перрико"], "54": ["Жердочки попики оценили. Сидят на них постоянно. Но никак до них не дойдёт,  что их ещё и грызть можно🙈", "2021-02-09T12:59:01Z", "", "0", 2, 0, 5, "Минеральные жердочки \"Морской Риф\" для попугаев, 2 шт", "перрико"], "55": ["Хорошие сидушки, птицы сидят охотно, видно, что удобно, розелла грыз и облизывал. Подходят для ожерелов и розелл.", "2021-02-09T01:27:33Z", "", "0", 1, 0, 5, "Минеральные жердочки \"Морской Риф\" для попугаев, 2 шт", "перрико"], "56": ["Доставили в хорошем состоянии. Палочки отличные. Попугаи одобрили  волнистые и корелла.", "2021-02-07T17:03:14Z", "", "0", 1, 0, 5, "Минеральные жердочки \"Морской Риф\" для попугаев, 2 шт", "перрико"], "57": ["Отличные жердочки! Мой Кеша сразу заценил и сидит на них, и грызëт с удовольствием. Правда клетка вся белая теперь 🙈", "2021-02-07T08:54:36Z", "", "0", 5, 0, 5, "